class EmailAuthBackend(object):

    def authenticate(self, username=None, password=None, user_model=None):
        """
        Authenticate a user based on the provided username and password.

        Args:
            username (str): The username or email to authenticate with.
            password (str): The password to authenticate with.
            user_model (Model): The user model to use for authentication. Defaults to django_User.

        Returns:
            The authenticated user instance if authentication is successful, otherwise None.
        """
        if user_model is None:
            user_model = django_User

        try:
            if user_model == django_User:
                user = user_model.objects.get(email=username)
            else:
                user = user_model.objects.filter(idUser__mail__contains=username).first()
            if user and user.check_password(password):
                return user
        except user_model.DoesNotExist:
            return None

    def auth_email(self, username=None, user_model=None):
        """
        Authenticate a user based on the provided email.

        Args:
            username (str): The email to authenticate with.
            user_model (Model): The user model to use for authentication. Defaults to django_User.

        Returns:
            The authenticated user instance if authentication is successful, otherwise None.
        """
        return self.authenticate(username=username, password=None, user_model=user_model)


