The `KBFileReader` class is responsible for reading CSV files and returning the data in a structured format. The `KBProcessor` class is responsible for processing the data, including adding a 'KB' source property to relationships and matching nodes. The `KBFileWriter` class is responsible for writing the processed data to CSV files.

The `OrderedDictionary` class remains unchanged, as it is a utility class that provides a way to access dictionary elements by index or string key.

The `main` function has been updated to create instances of the `MergeKBs` class and call its `mergeKBs` method to start the program.

